import React from 'react';
import { NavLink } from 'react-router-dom';
import './Footer.css'; // Asegúrate de que la ruta al archivo CSS sea correcta

import Facebook from '../icons8-facebook-nuevo.svg';
import Instagram from '../i'
const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="footer-section">
          <p>© 2024 | Colegio Científico de Alajuela</p>
        </div>
        <div className="footer-section social-media">
          <h4>Síguenos</h4>
          <div className="social-icons">
            <a href="http://facebook.com" className="footer-link">
              <img src='../icons8-facebook-nuevo.svg' alt='Logo de Facebook' className="social-icon"/>
            </a>
            <a href="http://instagram.com" className="footer-link">
              <img src='../icons8-instagram.svg' alt='Logo de Instagram' className="social-icon"/>
            </a>
            <a href="http://github.com" className="footer-link">
              <img src='../iconmonstr-github-1.svg' alt='Logo de GitHub' className="social-icon"/>
            </a>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
